import React, { Component } from 'react';
import './App.css';
import { Layout, Header, Navigation, Content, Drawer} from 'react-mdl';
import Main from './components/main';
import {Link} from 'react-router-dom';


class App extends Component {
  render() {
    return (
      <div className="big-content">
    <Layout>
        <Header title="Harris Schrick" scroll>
            <Navigation>
                <Link className="header-links-home" to="/">Home</Link>
                <Link className="header-links" to="/resume">Resume</Link>
                <Link className="header-links" to="/mywork">My Work</Link>
                <Link className="header-links" to="/contactme">Contact</Link>
            </Navigation>
        </Header>
        <Content>
            <div className="page-content" />
          <Main/>
        </Content>
    </Layout>
</div>
    );
  }
}

export default App;
